import React from'react'
import Home from '../pages/Home'

export default function Today (props) {

    const weather = props.weather

    console.log('today', weather)

    return(
        <div id='today'>
            <h1>Today</h1>
            {weather.data[0].timelines[0].intervals[0].values.cloudBase}
            
        </div>
    )
}
